import { Route, Redirect, Switch } from 'react-router-dom';
import { ConnectedRouter } from 'connected-react-router';

import Login from './containers/login';

function App(props) {
  return (
    <ConnectedRouter history={props.history}>
      <div className="App" >
        <h1>hello</h1>
      </div >
    </ConnectedRouter>
  );
}

export default App;
